import React, { ReactNode } from 'react'
type cardProps={
    height?:number,
    width?:number,
    background?:string,
    children:ReactNode
}
const Card = ({
    height=270,
    width=190,
    children
}:cardProps)=>{
    return(
        <div style={{height:`${height}px`,width:`${width}px`,background:'grey',borderRadius:'5px',display:'flex',
        flexDirection:'column',justifyContent:'center',alignContent:'center',border:'1px solid grey',overflow:'hidden',margin:'10px'}}>
           {children}
        </div>
    )
}
export default Card;
